import image45 from "./images/poke-logo.png";
import "./App.css";

function App() {
  return (
    <div className="image-decor">
      <img src={image45} />
      <h1>@pokemoncardsripstcglive</h1>
      <div className="text-bottom">Rip N Ship Live Everyday!</div>
      <button className="button-decor">DISCORD</button>
    </div>
  );
}

export default App;
